import Vue from "vue";
import { Component, Prop } from "vue-property-decorator";
import { StepperStep } from "../../types/Global";
import { getIdText } from "@/helpers";

@Component({})
export default class ATATSideStepper extends Vue {
  @Prop({ default: ()=>[] })  private stepperData!: StepperStep[]

  public setCurrentStep(stepNumber: string): void {
    this.activeStep = stepNumber;
  }

  private hasSubSteps(step: StepperStep) {
    return (
      Object.prototype.hasOwnProperty.call(step, "subSteps") &&
      step.subSteps?.length
    );
  }

  private getIdText(string: string) {
    return getIdText(string);
  }

  private getRouteName(step: StepperStep) {
    if (step.name !== "") return step.name;

    if (!this.hasSubSteps(step)) {
      throw new Error(
        `step: ${JSON.stringify(step)} doesn't have a name defined`
      );
    }

    //a stepper route with children should not have a named defined 
    // so we will use the child step name for routing
    return step.subSteps ? step.subSteps.length > 0 && step.subSteps[0].name : "";
  }
  private calculatePercentComplete() {
    this.percentComplete = 0;

    this.stepperData.forEach((step) => {
      if (step.completed && step.completePercentageWeight) {
        this.percentComplete += step.completePercentageWeight;
      } else if (this.hasSubSteps(step)) {
        step.subSteps?.forEach((subStep) => {
          if (subStep.completed && subStep.completePercentageWeight) {
            this.percentComplete += subStep.completePercentageWeight;
          }
        });
      }
    });
    this.percentComplete = Math.round(this.percentComplete);
  }

  public mounted(): void {
    this.calculatePercentComplete();
    this.activeStep = this.stepperData && this.stepperData.length > 0 ? 
      (this.stepperData[0].stepNumber || '') : '';
  }

  // data
  private activeStep = "";
  private percentComplete = 0;
}

import Vue from "vue";
import { Component, Prop, Watch } from "vue-property-decorator";

import SlideoutPanel from "@/store/slideoutPanel/index";

@Component({})

export default class ATATSlideoutPanel extends Vue {
  @Prop({ default: "380" }) private panelWidth!: string;

  public transitionEnded(e: Event):void {
    const target = e.currentTarget as HTMLElement;
    if (target) {
      const isOpen = target.classList.contains('v-navigation-drawer--open');
      isOpen ? SlideoutPanel.openSlideoutPanel("") : SlideoutPanel.closeSlideoutPanel();
    }
  }

  get panelTitle(): string {
    return SlideoutPanel.slideoutPanelTitle;
  }

  private isOpen = false;
  set isSlideoutPanelOpen(isOpen: boolean) {
    this.isOpen = isOpen;
  }
  /*
   * adds click event listener to overlay if Displayed
   * return isSlideoutPanelOpen
   */
  get isSlideoutPanelOpen(): boolean {
    const _isSlideoutPanelOpen = SlideoutPanel.slideoutPanelIsOpen;
    setTimeout(() => {
      if (_isSlideoutPanelOpen && this.showOverlay) {
        document
          .getElementsByClassName("v-overlay--active")[0]
          ?.addEventListener("click", this.closeSlideoutPanel);
      } else {
        document
          .getElementsByClassName("v-overlay--active")[0]
          ?.removeEventListener("click", this.closeSlideoutPanel);
      }
    }, 0);

    return _isSlideoutPanelOpen;
  }

  /*
   * showOverlay
   * returns boolean to show overlay when breakpoint is either sm or xs
   */
  get showOverlay(): boolean {
    return this.$vuetify.breakpoint.sm || this.$vuetify.breakpoint.xs;
  }

  /* A watcher used to set focus on the opener when the slideout panel is toggled.
   * When panel is closed, return focus to opener. If opener is no longer in the DOM,
   * focus on first h1. When panel is opened, set focus to panel title.
   */
  @Watch("isSlideoutPanelOpen")
  slideoutPanelToggle(isOpen: boolean): void {
    this.$nextTick(() => {
      if (isOpen) {
        document.getElementById("PanelTitle")?.focus();
        const wrapper = document.getElementById("PanelWrap");
        if (wrapper) {
          wrapper.scrollTop = 0;
        }
      } else {
        const returnFocusToElementId = SlideoutPanel.slideoutPanelOpenerId;
        setTimeout(function () {
          const focusEl =
            document.getElementById(returnFocusToElementId) ||
            document.getElementsByTagName("h1")[0];
          focusEl?.focus();
        }, 100);
      }
    });
  }

  private closeSlideoutPanel(): void {
    SlideoutPanel.closeSlideoutPanel();
  }
}

