import Vue from "vue";
import { Component, Mixins } from "vue-property-decorator";

import ATATTextField from "../../components/ATATTextField.vue";
import ATATTextArea from "../../components/ATATTextArea.vue";
import ATATRadioGroup from "../../components/ATATRadioGroup.vue";

import AcquisitionPackage, {StoreProperties} from "@/store/acquisitionPackage";
import SaveOnLeave from "@/mixins/saveOnLeave";
import { RadioButton } from "types/Global";
import { ProjectOverviewDTO } from "@/api/models";
import { hasChanges } from "@/helpers";


@Component({
  components: {
    ATATTextField,
    ATATTextArea,
    ATATRadioGroup,
  },
})
export default class ProjectOverview extends Mixins(SaveOnLeave) {
  private currentTitle = "";
  private projectScope = "";
  private emergencyDeclaration = "";
  private radioGroupItems: RadioButton[] = [
    {
      id: "Yes",
      label: "Yes",
      value: "yes",
    },
    {
      id: "No",
      label: "No",
      value: "no",
    },
  ];

  get Form(): Vue & { validate: () => boolean } {
    return this.$refs.form as Vue & { validate: () => boolean };
  }

  public async validateForm(): Promise<boolean> {
    let valid = false;

    await this.$nextTick(() => {
      valid = this.Form.validate();
    });
    return valid;
  }

  public get projectTitle(): string {
    return AcquisitionPackage.getTitle();
  }

  public set projectTitle(value: string) {
    AcquisitionPackage.setProjectTitle(value);
  }

  private get currentData(): ProjectOverviewDTO {
    return {
      title: this.currentTitle,
      scope: this.projectScope,
      emergency_declaration:
        this.emergencyDeclaration === "yes" ? "true" : "false",
    };
  }

  private get savedData(): ProjectOverviewDTO {
    return {
      title: AcquisitionPackage.projectOverview?.title || "",
      scope: AcquisitionPackage.projectOverview?.scope || "",
      emergency_declaration:
        AcquisitionPackage.projectOverview?.emergency_declaration || "false",
    };
  }

  public onTitleChanged(): void {
    this.projectTitle = this.currentTitle;
  }

  public async mounted(): Promise<void> {
    await this.loadOnEnter();
  }

  public async loadOnEnter(): Promise<void> {
    const storeData = 
    await AcquisitionPackage
      .loadData<ProjectOverviewDTO>({storeProperty: StoreProperties.ProjectOverview });

    if (storeData) {
      this.currentTitle = storeData.title;
      this.projectScope = storeData.scope;
      if(storeData.emergency_declaration && storeData.emergency_declaration.length > 0)
      {
        this.emergencyDeclaration = storeData.emergency_declaration === "true" ? "yes" : "no";
      }
    }
  }

  private hasChanged(): boolean {
    return hasChanges(this.currentData, this.savedData);
  }

  protected async saveOnLeave(): Promise<boolean> {
    try {
      if (this.hasChanged()) {
        // await AcquisitionPackage.saveProjectOverview(this.currentData);
        await AcquisitionPackage.saveData({ data: this.currentData, 
          storeProperty: StoreProperties.ProjectOverview});
      }
    } catch (error) {
      console.log(error);
    }

    return true;
  }
}

import Vue from "vue";
import { Component, Prop, PropSync } from "vue-property-decorator";
import ATATTooltip from "@/components/ATATTooltip.vue"
import ATATErrorValidation from "@/components/ATATErrorValidation.vue";
import ATATSVGIcon from "@/components/icons/ATATSVGIcon.vue";
import { mask } from "types/Global";
import Inputmask from "inputmask/";
import { toCurrencyString, currencyStringToNumber } from "@/helpers";

@Component({
  components: {
    ATATTooltip,
    ATATErrorValidation,
    ATATSVGIcon
  },
})
export default class ATATTextField extends Vue  {
  // refs
  $refs!: {
    atatTextField: Vue & { 
      errorBucket: string[]; 
      errorCount: number 
      resetValidation(): void
    };
  }; 

  // props
  @Prop({ default: true }) private dense!: boolean;
  @Prop({ default: true }) private singleLine!: boolean;
  @Prop({ default: "id_is_missing" }) private id!: string;
  @Prop({ default: "" }) private label!: string;
  @Prop({ default: "" }) private helpText!: string;
  @Prop({ default: "" }) private tooltipTitle!: string;
  @Prop({ default: "" }) private tooltipText!: string;
  @Prop({ default: "" }) private appendIcon!: string;
  @Prop({ default: "" }) private placeHolder!: string;
  @Prop({ default: () => [] }) private rules!: Array<unknown>;
  @Prop({ default: ""}) private suffix!: string;
  @Prop({ default: "" }) private optional!: boolean;
  @Prop({ default: "" }) private width!: string;
  @Prop({ default: "" }) private counter!: number;
  @Prop({ default: false }) private validateOnBlur!: boolean;
  @Prop() private extraEmitVal!: string;
  @Prop({ default: ()=>[] }) private mask!: string[];
  @Prop({ default: false }) private isMaskRegex!: boolean;
  @Prop({ default: false }) private isCurrency!: boolean;
  @Prop({ default: false }) private alignRight?: boolean;
  @Prop({ default: false }) private disabled?: boolean;
  @Prop({ default: true }) private showErrorMessages?: boolean;
  @Prop({ default: false }) private hideHelpTextOnErrors?: boolean;

  @PropSync("value", { default: "" }) private _value!: string;

  //data
  private errorMessages: string[] = [];
  private onInput(v: string) {
    this._value = v;
    if (this.isCurrency) {
      this.iconColor = v ? "base-darkest" : "base-light";
    }
  }

  private setErrorMessage(): void {
    Vue.nextTick(()=>{
      this.errorMessages = this.$refs.atatTextField.errorBucket;
    });
  }
  private iconColor = "base-light";

  //@Events
  private onBlur(e: FocusEvent) : void{
    const input = e.target as HTMLInputElement;
    this.setErrorMessage();
    this.$emit('blur', input.value, this.extraEmitVal);
    if (this.isCurrency) {
      this._value = toCurrencyString(currencyStringToNumber(input.value));
    }   
  }

  public resetValidation(): void {
    this.$refs.atatTextField.errorBucket = [];
    this.$refs.atatTextField.resetValidation();
  }

  private setMasks(): void {
    const maskObj: mask = {};

    if (this.isCurrency){
      maskObj.alias = "currency";
      maskObj.groupSeparator = ",";
      maskObj.digits = 2;
      maskObj.autoGroup = true;
      maskObj.digitsOptional = false;
      maskObj.rightAlign=false;
    } else if (this.mask.length > 0){
      if (this.isMaskRegex){
        maskObj.regex = this.mask[0] || "";
      } else {
        maskObj.mask = this.mask || [];
      }
    }
    
    if (Object.keys(maskObj).length>0){
      maskObj.placeholder="";
      maskObj.jitMasking=true;
      Vue.nextTick(()=>{
        const inputField = document.getElementById(
          this.id + '_text_field'
        ) as HTMLInputElement;
        Inputmask(maskObj).mask(inputField);
      });
    }
  }

  private mounted(): void{
    this.setMasks();
    if (this.isCurrency) {
      this.iconColor = this._value || this.disabled ? "base-darkest" : "base-light";
    }
  }

  private showHelpText(): boolean {
    if(this.errorMessages.length && this.hideHelpTextOnErrors){
      return false;
    }
    return  this.helpText.length > 0;
  }

}

