import SaveOnLeave from "@/mixins/saveOnLeave";
import ATATAlert from "../../components/ATATAlert.vue";
import ATATTextField from "../../components/ATATTextField.vue";

@Component({
  components: {
    ATATAlert,
    ATATTextField,
  },
})
export default class SurgeCapabilities extends Mixins(SaveOnLeave) {
  private surgeCapabilities = "";

  get contractPricePercentageRules(): unknown[] {
    const validationRules = [];
    validationRules.push(
      (v: number) => (v > 0 && v <= 50) || "Enter a number between 1-50"
    );
    validationRules.push(
      (v: string) => /[0-9]/.test(v) || "Enter a number between 1-50"
    );

    return validationRules;
  }

  private get currentData(): RequirementsCostEstimateDTO {
    return {
      surge_capabilities: this.surgeCapabilities,
    };
  }

  private savedData: RequirementsCostEstimateDTO = {
    surge_capabilities: "",
  };

  private hasChanged(): boolean {
    return hasChanges(this.currentData, this.savedData);
  }

  public async loadOnEnter(): Promise<void> {
    const storeData = await AcquisitionPackage.
      loadData<RequirementsCostEstimateDTO>({storeProperty: 
      StoreProperties.RequirementsCostEstimate});
    if (storeData) {
      this.savedData.surge_capabilities = storeData.surge_capabilities;
      this.surgeCapabilities = storeData.surge_capabilities || "";
    }
  }

  protected async saveOnLeave(): Promise<boolean> {
    try {
      if (this.hasChanged()) {
        await AcquisitionPackage
          .saveData<RequirementsCostEstimateDTO>({data: this.currentData, 
            storeProperty: StoreProperties.RequirementsCostEstimate});
      }
    } catch (error) {
      console.log(error);
    }

    return true;
  }
  public async mounted(): Promise<void> {
    await this.loadOnEnter();
  }
}

import Vue from "vue";

import { Component, Mixins } from "vue-property-decorator";
import ATATFileUpload from "../../components/ATATFileUpload.vue";
import { AttachmentTables } from "@/api";
import { AttachmentDTO } from "@/api/models";
import { invalidFile, uploadingFile } from "types/Global";
import Attachments from "@/store/attachments";
import ATATTextField from "@/components/ATATTextField.vue";
import FinancialDetails from "@/store/financialDetails";
import { hasChanges } from "@/helpers";
import SaveOnLeave from "@/mixins/saveOnLeave";

@Component({
  components: {
    ATATTextField,
    ATATFileUpload,
  },
})
export default class MIPR extends Mixins(SaveOnLeave)  {
  private uploadedFiles: uploadingFile[] = [];
  private invalidFiles: invalidFile[] = [];
  private validFileFormats = ["xlsx", "xls", "pdf"];
  private maxFileSizeInBytes = 1073741824;
  private saved = "";
  private MIPRNumber = ""
  private toolTip = `This number is assigned by your agency’s accounting and finance office.
   It is located in Box 5 on the MIPR form (DD Form 448).`
  private fileUploadHelpText = "Supported file types: PDF&nbsp;&nbsp;•" +
                                  "&nbsp;&nbsp;Max file size: 1GB&nbsp;&nbsp;•" +
                                  "&nbsp;&nbsp;Maximum 1 file";
  private requiredMessage = "You must include an authorized MIPR for this acquisition. " +
        "Please upload your missing document, or select Back to choose another method for " +
        "transferring funds.";

  // rules array dynamically created based on the invalid
  // files returned from the child component

  async loadOnEnter(): Promise<void> {
    try {
      this.saved = await FinancialDetails.getMIPRNumber();
      this.MIPRNumber = this.saved;
      const attachments = await Attachments.getAttachments(AttachmentTables.FundingPlans);
      const uploadedFiles = attachments.map((attachment: AttachmentDTO) => {
        const file = new File([], attachment.file_name, {
          lastModified: Date.parse(attachment.sys_created_on || "")
        });
        const upload: uploadingFile = {
          attachmentId: attachment.sys_id || "",
          fileName: attachment.file_name,
          file: file,
          created: file.lastModified,
          progressStatus: 100,
          link: attachment.download_link || "",
          recordId: attachment.table_sys_id,
          isErrored: false,
          isUploaded: true
        }
        return upload;
      });

      this.uploadedFiles = [...uploadedFiles];

    } catch (error) {
      throw new Error("an error occurred loading funding plans data");
    }
  }

  get current(): string {
    return this.MIPRNumber
  }
  private hasChanged(): boolean {
    return hasChanges(this.current, this.saved);
  }
  protected async saveOnLeave(): Promise<boolean> {
    try {
      if (this.hasChanged()) {
        FinancialDetails.setMIPRNumber(this.current);
      }
    } catch (error) {
      console.log(error);
    }
    return true;
  }

  async onRemoveAttachment(file: uploadingFile): Promise<void> {
    try {
      if (file) {
        const key = AttachmentTables.FundingPlans;
        const attachmentId = file.attachmentId;
        const recordId = file.recordId;
        await Attachments.removeAttachment({
          key,
          attachmentId,
          recordId,
        });
      }
    } catch (error) {
      console.error(`error removing attachment with id ${file?.attachmentId}`);
    }
  }

  public async mounted(): Promise<void> {
    await this.loadOnEnter();
  }

  // `ATATFileUpload.vue`
  private getRulesArray(): ((v: string) => string|true|undefined)[] {
    let rulesArr: ((v: string) => string | true | undefined)[] = [];
  
    rulesArr.push(this.$validators.required(this.requiredMessage));
    this.invalidFiles.forEach((iFile) => {
      rulesArr.push(
        this.$validators.isFileValid(
          iFile.file,
          this.validFileFormats,
          this.maxFileSizeInBytes,
          iFile.doesFileExist,
          iFile.SNOWError,
          iFile.statusCode
        )
      );
    });
    return rulesArr;
  }

}

