import Vue from "vue";
import { Component, Prop, PropSync } from "vue-property-decorator";
import ATATSVGIcon from "@/components/icons/ATATSVGIcon.vue";
import ATATFileList from "@/components/ATATFileList.vue";
import {
  FileAttachmentService,
  FileAttachmentServiceFactory,
} from "@/services/attachment";
import { invalidFile, uploadingFile } from "types/Global";
import ATATErrorValidation from "@/components/ATATErrorValidation.vue";

@Component({
  components: {
    ATATSVGIcon,
    ATATFileList,
    ATATErrorValidation,
  },
})
export default class ATATFileUpload extends Vue {

  // refs
  $refs!: {
    atatFileUpload: Vue & {
      errorBucket: string[];
      errorCount: number;
    };
    atatFileUploadForm: Vue & {
      resetValidation: () => void;
      reset: () => void;
    };
  };

  // props
  @Prop({ default: 15 }) private truncateLength!: string;
  @Prop({ default: "" }) private id!: string;
  @Prop({ default: "Use a PDF file with a max size of 1 GB." }) helpText!: string;
  @Prop({ default: true}) private multiplesAllowed!: boolean;
  @Prop({ default: "required"}) private requiredMessage!: string;
  @Prop({ default: 20 }) private maxNumberOfFiles!: number;
  
  @Prop({ default: () => [] }) private validFileFormats!: string[];
  @PropSync("invalidFiles", { default: () => [] })
  private _invalidFiles!: invalidFile[];
  @Prop({ default: "", required: true }) private attachmentServiceName!: string;
  @PropSync("rules", { default: () => [] }) private _rules!: ((
    v: string
  ) => string | true | undefined)[];
  
  //1073741824 is 1GB, the most SNOW will allow to upload
  @Prop({ default: 1073741824, required: true })
  private maxFileSizeInBytes!: number;
  
  @PropSync("validFiles", { default: () => [] })
  private _validFiles!: uploadingFile[];

  @Prop({ default: "" }) private fileListTitle!: string;

  private fileUploadControl!: HTMLInputElement;
  private isHovering = false;
  private isFullSize = true;
  private fileAttachmentService?: FileAttachmentService;
  private errorMessages: string[] = [];
  private validateOnBlur = true;
  
  
  get isFileUploadDisabled():boolean{
    return this.maxNumberOfFiles<=this._validFiles.length;
  }
  
  get isFileUploadDisplayed(): boolean {
    if (this.multiplesAllowed === false){
      return this._validFiles.length !== 1 || this.errorMessages.length > 0
    }
    return true;
  }

  //Events
  /**
   * triggers html file upload click
   */
  private fileUploadClicked(event: Event): void {
    if (this.isFileUploadDisabled === false){
      const eventSrc = event.target as HTMLElement;
      if (eventSrc.classList.contains("_text-link")) {
        event.preventDefault();
        event.stopPropagation();}

      (document.getElementById(this.id + "FileUpload") as HTMLInputElement).click();
      this.reset();
      this.isFullSize = this._validFiles.length === 0;
    }
  }

  // 
  /**
   * 1. sets uploadedFiles data
   * 2. removes unnecessary vuetify status msg
   */
  private fileUploadChanged(): void {
    this.removeInvalidFiles(this.fileUploadControl.files as FileList);
    Vue.nextTick(() => {
      //remove default vuetify status that displays after
      //upload (eg. '2 files')
      const vuetifyFileUploadStatus = document.getElementsByClassName(
        "v-file-input__text"
      )[0] as HTMLDivElement;
      if (vuetifyFileUploadStatus) {
        vuetifyFileUploadStatus.innerHTML = "";
      }
      Vue.nextTick(()=>{
        this.clearHTMLFileInput();
        (document.getElementById(this.id + "FileUpload") as HTMLInputElement).blur();
      })
    });
  }

  /**
   * prevents html dragevent from happening so as
   * drag event can be triggered with reactive data var `isHovering.`
   *
   * @param(e: DragEvent)
   */
  private onDragEnter(e: DragEvent): void {
    e.preventDefault();
    this.isHovering = true;
    this.isFullSize = this._validFiles.length === 0;
    this.reset();
    this.clearHTMLFileInput();
  }

  /**
   * prevents browser downloading file if file is dropped
   * outside of dropzone
   *
   * @param(e: DragEvent)
   */
  private preventDrop(e: DragEvent): void {
    e.preventDefault();
  }

  //Methods

  /**
   * sets this.files with files dragged to the control
   *
   * @param e:DragEvent
   *
   */
  private addDropFile(e: DragEvent): void {
    if (this.isFileUploadDisabled === false){
      this.isHovering = false;
      const dt = e.dataTransfer as DataTransfer;
      this.removeInvalidFiles(dt.files as FileList);
    }
  }

  /**
   * removes files with extensions not defined in
   * this.validFileFormats property
   *
   * @params (files: FileList)
   *
   */
  private removeInvalidFiles(files: FileList): void {
    let _validFiles = Array.from(files || []).filter((vFile) => {
      const thisFileFormat = vFile.name.substring(
        vFile.name.lastIndexOf(".") + 1
      );
      const isValidFormat = this.validFileFormats.some(
        (format) => thisFileFormat === format
      );

      const doesFileExist = this._validFiles.some((fileObj) => {
        return (
          vFile.name === fileObj.file?.name &&
          vFile.lastModified === fileObj.file.lastModified &&
          vFile.size === fileObj.file.size
        );
      });

      const isFileSizeValid = vFile.size < this.maxFileSizeInBytes;

      //log Invalid Files
      if (!isValidFormat) {
        this.logInvalidFiles(vFile, doesFileExist);
      }
      if (doesFileExist) {
        this.logInvalidFiles(vFile, doesFileExist);
      }
      if (!isFileSizeValid) {
        this.logInvalidFiles(vFile, doesFileExist);
      }

      return isValidFormat && !doesFileExist && isFileSizeValid;
    });
    
    //allows for maxNumberOfFiles to be uploaded
    
    if(this.maxNumberOfFiles<_validFiles.length){
      _validFiles = _validFiles.filter((obj, idx)=>{
        return idx<this.maxNumberOfFiles
      })
    }

    this.createFileObjects(_validFiles);
  }

  private createFileObjects(validFiles: File[]): void {
    validFiles.forEach((vFile) => {
      this._validFiles.push({
        file: vFile,
        fileName: vFile.name,
        created: vFile.lastModified,
        progressStatus: 0,
        link: "",
        attachmentId: "",
        recordId: "",
        isErrored: false,
        isUploaded: false,
      });
    });
    this.uploadFiles();
  }

  private uploadFiles(): void {
    for (let i = 0; i < this._validFiles.length; i++) {
      //wire up file upload here
      let uploadingFileObj = this._validFiles[i] as uploadingFile;

      // only new files are uploaded
      if (!uploadingFileObj.isUploaded) {
        window.setTimeout(() => {
          this.fileAttachmentService
            ?.upload(uploadingFileObj.file, (total, current) => {
              current = 0;
              total = Math.ceil(total / 1000);
              let progress = window.setInterval(() => {
                if (current < total) {
                  current = current + Math.floor(Math.random() * total);
                  uploadingFileObj.progressStatus = (current / total) * 100;
                } else {
                  clearInterval(progress);
                  uploadingFileObj.progressStatus = 100;
                }
              }, 500);
            })
            .then((result) => {
              //download link - link to the file download
              //sys_id the unique id of the attachment in the attachment table
              //table_sys_id the unique id of the table/record

              const { download_link, sys_id, table_sys_id } = result.attachment;
              uploadingFileObj.link = download_link || "";
              uploadingFileObj.attachmentId = sys_id || "";
              uploadingFileObj.recordId = table_sys_id;
              uploadingFileObj.isUploaded = true;

              this.$emit('uploaded', uploadingFileObj);
            })
            .catch((error) => {
              //file upload error occurred
              uploadingFileObj.isErrored = true;
              console.log(`file upload error ${error}`);
              this.logInvalidFiles(
                uploadingFileObj.file,
                false,
                error?.response?.data?.error.message || error.message,
                error?.response?.status || 0
              );
            });
        }, i * 1000);
      }
    }
  }

  private logInvalidFiles(
    file: File,
    doesFileExist: boolean,
    SNOWError?: string,
    statusCode?: number
  ): void {
    const doesFileExistInInvalidFiles = this._invalidFiles.some(
      (iFile) =>
        iFile.file.name === file.name &&
        iFile.file.size === file.size &&
        iFile.file.lastModified === file.lastModified
    );
    if (!doesFileExistInInvalidFiles) {
      this._invalidFiles.push({ file, doesFileExist, SNOWError, statusCode });
    }
    if (this._invalidFiles.length > 0) {
      this.setErrorMessage();
    }
  }

  private setErrorMessage(): void {
    this.$nextTick(() => {
      this.errorMessages = this.$refs.atatFileUpload.errorBucket;
      if (this._invalidFiles.length > 0){
        this.errorMessages = this.errorMessages.filter(
          (msg)=>msg !== this.requiredMessage
        );
      }
    });
  }

  private clearErrorMessages(): void {
    Vue.nextTick(() => {
      this.$refs.atatFileUploadForm.reset();
      Vue.nextTick(() => {
        this.$refs.atatFileUploadForm.resetValidation();
      });
    });
  }

  private reset(): void {
    Vue.nextTick(() => {
      this._invalidFiles = [];
      this.clearErrorMessages();
      this.errorMessages = [];
    });
  }

  /**
   * Clears out all files form HTML File Input
   */
  private clearHTMLFileInput():void{
    const fileInput = document.getElementById(this.id + "FileUpload") as HTMLInputElement;
    fileInput.value = "";
  }

  //life cycle hooks
  private mounted(): void {
    this.fileUploadControl = document.getElementById(
      this.id + "FileUpload"
    ) as HTMLInputElement;

    //prevents Browser from downloading the file if file is accidentally
    //dropped outside of dropzone
    window.addEventListener("drop", this.preventDrop, false);
    window.addEventListener("dragover", this.preventDrop, false);

    //try to grab the attachment service via the service factory
    this.fileAttachmentService = FileAttachmentServiceFactory(
      this.attachmentServiceName
    );
    
    this._invalidFiles = [];  
  }

  private updated(): void {
    this.isFullSize = this._validFiles.length === 0;
  }
}

import Vue from "vue";
import { Component, Prop, PropSync, Watch } from "vue-property-decorator";
import ATATFileListItem from "@/components/ATATFileListItem.vue";
import ATATSVGIcon from "@/components/icons/ATATSVGIcon.vue";
import { uploadingFile } from "types/Global";

@Component({
  components: {
    ATATFileListItem,
    ATATSVGIcon,
  },
})
export default class ATATFileList extends Vue {
  @Prop({ default: "61686c" }) private color!: string;
  @Prop({ default: () => [] }) private validFiles!: uploadingFile[];
  @PropSync("isFullSize", {default: true}) private _isFullSize!: boolean;
  @Prop({ default: true }) private multiplesAllowed!: boolean;
  @Prop({ default: "" }) private title!: string;
  private uploadingFiles: uploadingFile[] = [];

  /**
   * sets title to plural when necessary
   */
  private getFileUploadsDivTitle(): string {

    if(this.title.length > 0)
    {
      return this.title;
    }
    
    if (this.multiplesAllowed){
      return "Your Upload" + (this.uploadingFiles.length > 1 ? "s" : "");
    }
    return ''
  }

  /**
   * @param idx: number
   * removes file from both file arrays at index 
   */
  private removeFiles(idx: number): void {
    Vue.nextTick(()=>{
      const fileToDelete = this.uploadingFiles[idx];
      this.uploadingFiles.splice(idx, 1);
      this.validFiles.splice(idx,1);
      this._isFullSize = this.validFiles.length === 0;
      this.$emit('delete', fileToDelete);
    })
  }

  /**
   * add files to this.files when necessary
   * preventing the same file from being displayed
   * multiple times
   */
  @Watch("validFiles")
  protected setFilesToDisplay(): void{
    if (this.uploadingFiles.length<this.validFiles.length){
      this.validFiles.forEach((vFile)=>{
  
        const doesFileExist = this.uploadingFiles.some((fileObj) => {
          return vFile.file.name === fileObj.file.name
            && vFile.file.lastModified === fileObj.file.lastModified
            && vFile.file.size === fileObj.file.size;
        });

        if (!doesFileExist){
          this.uploadingFiles.push(vFile);
        }
      });
    }
  }
}

import Vue from "vue";
import { Component, Prop, Watch } from "vue-property-decorator";
import ATATSVGIcon from "@/components/icons/ATATSVGIcon.vue";
import { format } from "date-fns";
import { formatInTimeZone } from "date-fns-tz";
import { uploadingFile } from "types/Global";

@Component({
  components: {
    ATATSVGIcon,
  },
})
export default class ATATFileListItem extends Vue {
  /** PROPS */
  @Prop({ default: 0 }) private index!: number;
  @Prop({ default: () => ({}) }) private uploadingFileObj!: uploadingFile;

  /** DATA */
  get isLoading(): boolean {

    return this.uploadingFileObj && 
    this.uploadingFileObj.progressStatus < 100 &&
    this.uploadingFileObj.isErrored === false
  }



  /**
   * Watches for `isErrored` to change after
   * file uploads to SNOW. If `true` remove file
   * and stop progress bar
   */
  @Watch("uploadingFileObj.isErrored")
  protected IsFileErrored(newVal: boolean): void {
    if (newVal) {
      this.removeFile(this.index);
    }
  }

  /**
   * formats lastModifiedDate w/timezone
   */

  private getLastModifiedDate(): string {
    return (
      format(new Date(), "MMM dd, yyyy HHmm") +
      " " +
      formatInTimeZone(new Date(), "America/New_York", "zzz")
    );
  }

  /**
   * formats truncated filename
   */

  private getTruncatedFileName(filename: string): string {
    if (filename.length > 45) {
      return (
        filename.substr(0, 45) +
        "..." +
        filename.substr(filename.length - 13, filename.length)
      );
    }
    return filename;
  }

  /**
   * @param filename: string
   * returns extension
   */
  private getExtension(filename: string): string {
    return "..." + filename.substr(filename.length - 13, filename.length);
  }

  /**
   * @param fileName: string
   * returns if file is PDF
   */

  private isPDF(fileName: string): boolean {
    return (
      fileName.substr(fileName.lastIndexOf(".") + 1).toLowerCase() === "pdf"
    );
  }

  /**
   * @param idx: number
   *
   * removes file at index
   */
  private removeFile(idx: number): void {
    Vue.nextTick(() => {
      this.$emit("removeFiles", idx);
    });
  }
}

import { Component, Mixins, Watch } from "vue-property-decorator";
import { RadioButton } from "../../../types/Global";
import ATATRadioGroup from "@/components/ATATRadioGroup.vue";
import ATATExpandableLink from "@/components/ATATExpandableLink.vue";
import ATATAlert from "@/components/ATATAlert.vue";
import Periods from "@/store/periods";
import FinancialDetails from "@/store/financialDetails";
import { routeNames } from "@/router/stepper";
import SaveOnLeave from "@/mixins/saveOnLeave";
import TaskOrder from "@/store/taskOrder";
import AcquisitionPackage from "@/store/acquisitionPackage";
import { PeriodDTO } from "@/api/models";
import { hasChanges } from "@/helpers";

@Component({
  components: {
    ATATRadioGroup,
    ATATExpandableLink,
    ATATAlert,
  }
})

export default class SeverabilityAndIncrementalFunding extends Mixins(SaveOnLeave) {
  private selectedFundOption = "";
  private savedFundOption = "";
  private isPeriodsDataMissing = false;
  private isCostEstimateMissing = false;
  private routeNames = routeNames;
  private base: PeriodDTO = {
    /* eslint-disable camelcase */
    period_unit: "",
    period_unit_count: "",
    period_type: "",
    option_order: "",
  };
  private incrementallyFundOptions: RadioButton[] = [
    {
      id: "Yes",
      label: "Yes. I need to provide an incremental funding plan.",
      value: "YES",
    },
    {
      id: "No",
      label: "No. This requirement will be funded entirely up-front.",
      value: "NO",
    },
  ];

  public get isPoPAndCostEstimateMissing(): boolean {
    return this.isCostEstimateMissing && this.isPeriodsDataMissing;
  }

  public get isOnlyPoPyMissing(): boolean {
    return !this.isCostEstimateMissing && this.isPeriodsDataMissing;
  }

  public get isOnlyCostEstimateMissing(): boolean {
    return this.isCostEstimateMissing && !this.isPeriodsDataMissing;
  }

  public get route(): string {
    return this.isOnlyCostEstimateMissing
      ? this.routeNames.RequirementsCostForm
      : this.routeNames.PeriodOfPerformance;
  }

  public get linkText(): string {
    return this.isOnlyCostEstimateMissing
      ? "Requirements Cost Estimate section"
      : "Contract Details section";
  }

  public get PoPUnder9Months(): boolean {
    return AcquisitionPackage.totalBasePoPDuration < 270 
      && AcquisitionPackage.totalBasePoPDuration > 0;
  }

  public get basePeriod(): string {
    const hasBasePeriod = this.base && this.base.period_unit_count && this.base.period_unit;
    return hasBasePeriod
      ? `${this.base.period_unit_count} ${this.base.period_unit.toLowerCase()}`
      : ""
  }

  public async loadOnEnter(): Promise<void> {
    const periods = await Periods.loadPeriods();
    this.isPeriodsDataMissing = (periods && periods.length === 0);
    const estimatedTOValue = await FinancialDetails.getEstimatedTaskOrderValue();
    this.isCostEstimateMissing = !estimatedTOValue;
    this.savedFundOption = await TaskOrder.isIncrementallyFunded();
    this.selectedFundOption = this.savedFundOption;
    this.base = periods[0];
  }

  public async mounted(): Promise<void> {
    await this.loadOnEnter();
  }
  private hasChanged(): boolean {
    const current = this.selectedFundOption.length > 0 ? this.selectedFundOption : "";
    return hasChanges(current, this.savedFundOption);
  }

  protected async saveOnLeave(): Promise<boolean> {
    try {
     
      if (this.hasChanged()) {
        const taskOrder = {
          ...TaskOrder.value,
          // eslint-disable-next-line camelcase
          incrementally_funded: this.selectedFundOption
        };
        await TaskOrder.save(taskOrder);
      }
    } catch (error) {
      console.log(error);
    }

    return true;
  }



  @Watch("selectedFundOption")
  protected showAlert(): boolean {
    return this.selectedFundOption === "YES"
      && (this.isPeriodsDataMissing || this.isCostEstimateMissing)
  }
}

import { Component, Mixins } from "vue-property-decorator";

import ATATSelect from "@/components/ATATSelect.vue";
import ATATTextField from "@/components/ATATTextField.vue";
import ATATSVGIcon from "@/components/icons/ATATSVGIcon.vue";

import FinancialDetails from "@/store/financialDetails";
import Periods from "@/store/periods";

import { PeriodDTO } from "@/api/models";
import { SelectData, fundingIncrement, IFPData } from "../../../types/Global";
import { toCurrencyString, currencyStringToNumber } from "@/helpers";

import SaveOnLeave from "@/mixins/saveOnLeave";
import { hasChanges } from "@/helpers";

@Component({
  components: {
    ATATSelect,
    ATATSVGIcon,
    ATATTextField,
  }
})

export default class IncrementalFunding extends Mixins(SaveOnLeave) {

  public today = new Date();
  public currentQuarter = Math.floor(((this.today.getMonth() + 3) / 3) + 1);
  public currentYear = this.today.getFullYear();

  public periods: PeriodDTO[] | null = [];
  public maxPayments = 1;
  public periodLengthStr = "";

  public ordinals = ["1st", "2nd", "3rd", "4th"];

  public costEstimate = 0;
  public costEstimateStr = "";
  public amountRemaining = 0;
  public amountRemainingStr = "";
  public initialAmount = 0;
  public initialAmountStr = "";
  public totalAmount: number | null = null;

  public errorMissingInitialIncrement = false;
  public errorMissingInitialIncrementMessage = "Please enter the amount of your initial funding.";
  public errorMissingFirstIncrement = false;
  public errorMissingFirstIncrementMessage = "Please enter the amount of your first increment.";

  // use in future ticket for validation returning to page to show error messages
  public hasReturnedToPage = false;

  public fundingIncrements: fundingIncrement[] = [];

  private get currentData(): IFPData {
    return {
      initialFundingIncrementStr: this.initialAmountStr,
      fundingIncrements: this.fundingIncrements,
    };
  };

  private savedData: IFPData = {
    initialFundingIncrementStr: "",
    fundingIncrements: [],
  }

  public fiscalQuarters: { text: string, order: number }[] = [];

  public async initializeIncrements(): Promise<void> {
    let qtr = this.currentQuarter;
    let year = parseInt(this.currentYear.toString().slice(-2));
    for (let i = 0; i < 6; i++) {
      const ordinal = this.ordinals[qtr - 1];
      // increment year if at first quarter and not first in the loop
      year = qtr === 1 && i !== 0 ? year + 1 : year;
      // increment quarter
      qtr = qtr === 4 ? 1 : qtr + 1;
      const periodStr = ordinal + " QTR FY" + year;
      this.fiscalQuarters.push({ text: periodStr, order: i + 1 });

      if (i === 0 && this.fundingIncrements.length === 0) {
        // default to 1st option if no store data
        this.fundingIncrements.push({ qtr: periodStr, amt: "", order: 1, sysId: "" })
      }
    }
  }

  public removedIncrements: fundingIncrement[] = [];

  public deleteFundingIncrement(index: number): void {
    if (this.savedData.fundingIncrements && this.fundingIncrements[index].sysId) {
      const incr = this.savedData.fundingIncrements[index];
      if (incr) {
        this.removedIncrements.push(incr);
      }
    }

    this.fundingIncrements.splice(index, 1);
    this.calcAmounts("");
  }

  public addIncrement(): void {
    const lastFundingIncrement = this.fundingIncrements.at(-1);
    const lastSelectedQtr = lastFundingIncrement?.qtr;
    let selectedQtrIndex = this.fiscalQuarters.findIndex(p => p.text === lastSelectedQtr);
    let nextQtr;
    if (selectedQtrIndex > -1 && selectedQtrIndex !== this.fiscalQuarters.length) {
      nextQtr = this.fiscalQuarters[selectedQtrIndex + 1].text;
    }
    if (nextQtr) {
      const newIncrement = { 
        qtr: nextQtr, 
        amt: "", 
        order: this.fundingIncrements.length + 1,
        sysId: "" 
      }
      this.fundingIncrements.push(newIncrement);
    }
  }

  public calcAmounts(field: string): void {
    let incrementsTotal = this.fundingIncrements.reduce(
      (accumulator, current) =>  
        accumulator + Number(currencyStringToNumber(current.amt)), 0
    );
    this.initialAmount = currencyStringToNumber(this.initialAmountStr);
    this.totalAmount = this.initialAmount 
      ? this.initialAmount + incrementsTotal
      : incrementsTotal;

    this.amountRemaining = this.costEstimate - this.totalAmount;
    this.amountRemainingStr = this.amountRemaining ? toCurrencyString(this.amountRemaining) : "";
    this.initialAmountStr = this.initialAmount ? toCurrencyString(this.initialAmount) : "";
    this.$nextTick(() => {
      this.fundingIncrements.forEach((incr) => {
        return incr.amt = incr.amt && incr.amt !== "0.00" 
          ? toCurrencyString(currencyStringToNumber(incr.amt)) 
          : ""
      });
    });

    // validation on blur for initial and first increments required
    let amt;
    if (field === "initialIncrement") {
      amt = parseFloat(this.initialAmountStr);
      this.errorMissingInitialIncrement = amt === 0 || isNaN(amt);
    } else if (field === "increment0") {
      amt = parseFloat(this.fundingIncrements[0].amt);
      this.errorMissingFirstIncrement = amt === 0 || isNaN(amt);
    }
  }

  public getFiscalQuarters(index: number): SelectData[] {
    if (index === 0) {
      return this.fiscalQuarters;
    } 

    const firstSelectedQtr = this.fundingIncrements[0].qtr;
    const firstSelectedQtrIndex 
      = this.fiscalQuarters.findIndex(p => p.text === firstSelectedQtr);

    let lastPossibleIndex = firstSelectedQtrIndex + this.maxPayments;
    lastPossibleIndex = lastPossibleIndex > this.fiscalQuarters.length 
      ? this.fiscalQuarters.length
      : lastPossibleIndex;
    let optionsArr = this.fiscalQuarters.slice(firstSelectedQtrIndex + 1, lastPossibleIndex) 

    return optionsArr;
  }

  public async loadOnEnter(): Promise<void> {
    const estimatedTOValue = await FinancialDetails.getEstimatedTaskOrderValue();
    if (estimatedTOValue) {
      this.costEstimate = currencyStringToNumber(estimatedTOValue);
      this.costEstimateStr = toCurrencyString(this.costEstimate);
    }

    const storeData = await FinancialDetails.loadIFPData();
    if (storeData) {
      this.savedData = storeData;
      this.fundingIncrements = [...storeData.fundingIncrements];
      this.initialAmountStr = storeData.initialFundingIncrementStr;
      this.initialAmount = currencyStringToNumber(this.initialAmountStr);

      this.calcAmounts("");

      // use below for future validation ticket
      this.hasReturnedToPage = this.fundingIncrements.length > 0;
    }

    await this.initializeIncrements();

    this.periods = Periods.periods;
    if (this.periods) {
      const basePeriod = this.periods.find(p => p.period_type === "BASE");
      if (basePeriod) {
        const unitCount: number = parseInt(basePeriod.period_unit_count);
        let unit = basePeriod.period_unit.toLowerCase();
        if (unitCount) {
          unit = unitCount > 1 ? unit + "s" : unit;
        }
        this.periodLengthStr = unitCount + " " + unit;
        switch (unit) {
        case "days": 
          this.maxPayments = unitCount > 270 ? 5: 4;
          break;
        case "weeks":
          this.maxPayments = unitCount > 36 ? 5: 4;
          break;
        case "months":
          this.maxPayments = unitCount > 9 ? 5: 4;
          break;
        case "year":
          this.maxPayments = 5;
          break;
        default:
          this.maxPayments = 1;
        }
      }
    }
  }

  public async mounted(): Promise<void> {
    await this.loadOnEnter();
  }

  protected async saveOnLeave(): Promise<boolean> {
    try {
      // FUTURE TICKET VALIDATION: first time user clicks continue:
      // • check if same quarter selected for more than one dropdown
      // • check if over/under funded - AC 4 which was crossed out
      // set a flag if error has been shown. if so, user can continue

      // Set chronological order of fiscal quarters in fundingIncrements
      let sortedIncrements: fundingIncrement[] = []; 
      this.fundingIncrements.forEach((incr) => {
        incr.order = this.fiscalQuarters.findIndex(q => q.text === incr.qtr) + 1;
        sortedIncrements.push(incr);
      });
      sortedIncrements.sort((a,b) => { 
        return a.order > b.order ? 1 : -1 
      })
      sortedIncrements.forEach((incr, i) => {
        incr.order = i + 1;
      });

      this.fundingIncrements = sortedIncrements;

      if (this.hasChanged()) {
        FinancialDetails.saveIFPData(
          { 
            data: this.currentData, 
            removed: this.removedIncrements 
          }
        );
      }
    } catch (error) {
      console.log(error);
    }

    return true;
  }

  private hasChanged(): boolean {
    return hasChanges(this.currentData, this.savedData);
  }


}

