      resetValidation: () => void;
      reset: () => void;
    };
  };

  //props
  @Prop() private loaded!: boolean
  @PropSync("showAccessRadioButtons") private _showAccessRadioButtons!: boolean;
  @PropSync("selectedPhoneCountry") private _selectedPhoneCountry?: string;

