import Vue from "vue";
import { Component, Prop, Watch } from "vue-property-decorator";
import Chart, { ChartData, ChartOptions } from "chart.js/auto";
import ChartDataLabels from "chartjs-plugin-datalabels";
import { toCurrencyString } from "@/helpers";

@Component({})
export default class DonutChart extends Vue {
  @Prop({ required: true, default: "MyDonutChart" }) public chartId!: string;
  @Prop({ required: true, default: {} }) public chartData!: ChartData;
  @Prop({ required: true, default: {} }) public chartOptions!: any;
  @Prop({ required: false, default: false })
  public useChartDataLabels!: boolean;
  @Prop({ required: false, default: false }) public isArcGauge!: boolean;
  @Prop({ required: false, default: "" }) public centerText1!: string;
  @Prop({ required: false, default: "" }) public centerText2!: string;
  @Prop({ required: false, default: "" }) public amount!: number;

  private myChart!: Chart;

  @Watch("chartData", { deep: true })
  public chartDataUpdate(newData: ChartData): void {
    this.myChart.data = newData;
    this.myChart.update();
  }

  private mounted() {
    const toolTipExternalOptions = {
      enabled: false,
      position: "nearest",
      external: this.externalTooltipHandler,
    };

    this.chartOptions.plugins.tooltip = toolTipExternalOptions;

    this.createChart();
  }

  public createChart(): void {
    const centertext = this.centertext(this);
    if (this.chartId) {
      let plugins: any = [centertext];
      if (this.useChartDataLabels) {
        plugins.push(ChartDataLabels);
      }
      const ctx = document.getElementById(this.chartId) as HTMLCanvasElement;
      this.myChart = new Chart(ctx, {
        type: "doughnut",
        data: this.chartData,
        options: this.chartOptions,
        plugins: plugins,
      });
    }
  }

  public centertext(self: any): any {
    const centertext: any = {
      id: "centertext",
      beforeDraw: function(chart: any) {
        const width = chart.width,
          height = chart.height,
          ctx = chart.ctx;

        const text1divisors = self.isArcGauge
          ? { fontSize: 40, textY: 1.5 }
          : { fontSize: 160, textY: 2.2 };
        const text2divisors = self.isArcGauge
          ? { fontSize: 140, textY: 1 }
          : { fontSize: 350, textY: 1.75 };

        ctx.restore();
        let fontSize = (height / text1divisors.fontSize).toFixed(2);
        ctx.font = "bold " + fontSize + "em 'Roboto Condensed'";
        ctx.textBaseline = "middle";
        let text = self.centerText1,
          textX = Math.round((width - ctx.measureText(text).width) / 2),
          textY = height / text1divisors.textY;

        ctx.fillText(text, textX, textY);
        ctx.save();

        fontSize = (height / text2divisors.fontSize).toFixed(2);
        ctx.font = fontSize + "em 'Roboto'";
        ctx.textBaseline = "bottom";

        text = self.centerText2;
        textX = Math.round((width - ctx.measureText(text).width) / 2);
        textY = height / text2divisors.textY;
        ctx.fillText(text, textX, textY);
        ctx.save();
      },
    };
    return centertext;
  }
  public externalTooltipHandler = (context: any) => {
    const { chart, tooltip } = context;
    const tooltipEl = this.getOrCreateTooltip(chart);

    // Hide if no tooltip
    if (tooltip.opacity === 0) {
      tooltipEl.style.opacity = 0;
      return;
    }

    if (tooltip.body) {
      const bodyLines = tooltip.body.map((b: any) => b.lines);
      const labelText = bodyLines[0][0];
      const sep = labelText.indexOf(":");
      const color = tooltip.labelColors[0].backgroundColor;

      const colorBlock = document.createElement("span");
      colorBlock.style.background = color;
      colorBlock.style.borderColor = "#ffffff";
      colorBlock.style.borderStyle = "solid";
      colorBlock.style.borderWidth = "1px";
      colorBlock.style.marginRight = "4px";
      colorBlock.style.height = "16px";
      colorBlock.style.width = "16px";
      colorBlock.style.display = "inline-block";
      colorBlock.style.marginRight = "4px";

      const label = labelText.slice(0, sep);
      const text = document.createTextNode(label)
      const labelSpan = document.createElement("span");
      labelSpan.style.fontWeight = "700";
      labelSpan.style.fontSize = "14px";
      labelSpan.style.marginRight = "16px";
      labelSpan.appendChild(text);

      const percentNo = parseFloat(labelText.slice(sep + 2, labelText.length));
      const amount = "$" + toCurrencyString(this.amount * percentNo / 100);
      const amountNode = document.createTextNode(amount)
      const percentSpan = document.createElement("span");
      percentSpan.style.fontSize = "14px";
      percentSpan.appendChild(amountNode);

      const tooltipDiv = tooltipEl.querySelector("div#DonutChartTooltipDiv");
      // Remove old children
      while (tooltipDiv.firstChild) {
        tooltipDiv.firstChild.remove();
      }

      tooltipDiv.appendChild(colorBlock);
      tooltipDiv.appendChild(labelSpan);
      tooltipDiv.appendChild(percentSpan);

      const { offsetLeft: positionX, offsetTop: positionY } = chart.canvas;

      // Display, position, and set styles for font
      tooltipEl.style.opacity = 1;
      tooltipEl.style.left = positionX + tooltip.caretX + "px";
      tooltipEl.style.top = positionY + tooltip.caretY + "px";
      tooltipEl.style.font = tooltip.options.bodyFont.string;
      tooltipEl.style.padding =
        tooltip.options.padding + "px " + tooltip.options.padding + "px";
    }
  }

  public getOrCreateTooltip = (chart: any) => {
    let tooltipEl = chart.canvas.parentNode.querySelector("div#DonutChartTooltip");
    if (!tooltipEl) {
      tooltipEl = document.createElement("div");
      tooltipEl.setAttribute("id", "DonutChartTooltip");
      tooltipEl.style.background = "rgba(27, 27, 27, 0.9)";
      tooltipEl.style.borderRadius = "3px";
      tooltipEl.style.color = "white";
      tooltipEl.style.opacity = 1;
      tooltipEl.style.pointerEvents = "none";
      tooltipEl.style.position = "absolute";
      tooltipEl.style.transform = "translate(8%, -50%)";
      tooltipEl.style.transition = "all .1s ease";

      const div = document.createElement("div");
      div.setAttribute("id", "DonutChartTooltipDiv");
      div.style.margin = "0px";
      div.style.display = "flex";
      div.style.alignItems = "center";

      tooltipEl.appendChild(div);
      chart.canvas.parentNode.appendChild(tooltipEl);
    }

    return tooltipEl;
  };
}

import Vue from "vue";
import { Component, Prop, Watch } from "vue-property-decorator";
import Chart, { ChartData } from "chart.js/auto";

@Component({})
export default class LineChart extends Vue {
  @Prop({ required: true, default: "myLineChart" }) public chartId!: string;
  @Prop({ required: true, default: {} }) public chartData!: ChartData;
  @Prop({ required: true, default: {} }) public chartOptions!: any;
  @Prop({ required: false }) public datasetToToggle!: number;
  @Prop({ required: false }) public toggleDataset!: boolean;
  @Prop({ required: false }) public tooltipHeaderData!: Record<string, string>;
  private myChart!: Chart;

  @Watch("chartData", { deep: true })
  public chartDataUpdate(newData: ChartData): void {
    this.myChart.data = newData;
    this.myChart.update();
  }

  @Watch("toggleDataset")
  protected doToggleDataset(): void {
    const i = this.datasetToToggle;
    const isDatasetVisible = this.myChart.isDatasetVisible(i);
    if (isDatasetVisible) {
      this.myChart.hide(i); // actual spend (solid)
      this.myChart.hide(i + 1); // burndown (dashed)
    } else {
      this.myChart.show(i);
      this.myChart.show(i + 1);
    }
  }

  private currentMonthLine: any = {
    id: "currentMonthLine",
    beforeDraw: (chart: any) => {
      if (chart.tooltip._active && chart.tooltip._active.length) {
        const ctx = chart.ctx;
        ctx.save();
        const activePoint = chart.tooltip._active[0];
        ctx.beginPath();
        ctx.moveTo(activePoint.element.x, chart.chartArea.top);
        ctx.lineTo(activePoint.element.x, chart.chartArea.bottom);
        ctx.lineWidth = 3;
        ctx.strokeStyle = "rgba(180,180,180,1)";
        ctx.stroke();
        ctx.restore();
      }
    },
  };

  private mounted() {
    const toolTipExternalOptions = {
      enabled: false,
      position: "nearest",
      external: this.externalTooltipHandler,
    };
    this.chartOptions.plugins.tooltip = toolTipExternalOptions;
    this.createChart();
  }

  public createChart(): void {
    if (this.chartId) {
      const ctx = document.getElementById(this.chartId) as HTMLCanvasElement;
      this.myChart = new Chart(ctx, {
        type: "line",
        data: this.chartData,
        options: this.chartOptions,
        plugins: [this.currentMonthLine],
      });
    }
  }

  public getOrCreateTooltip = (chart: any) => {
    let tooltipEl = chart.canvas.parentNode.querySelector("div#lineChartTooltip");

    if (!tooltipEl) {
      tooltipEl = document.createElement("div");
      tooltipEl.setAttribute("id", "lineChartTooltip");
      tooltipEl.style.background = "rgba(27, 27, 27, 0.9)";
      tooltipEl.style.borderRadius = "3px";
      tooltipEl.style.color = "white";
      tooltipEl.style.opacity = 1;
      tooltipEl.style.pointerEvents = "none";
      tooltipEl.style.position = "absolute";
      tooltipEl.style.transform = "translate(8%, -50%)";
      tooltipEl.style.transition = "all .1s ease";

      const table = document.createElement("table");
      table.setAttribute("id", "lineChartTooltipTable");
      table.style.margin = "0px";

      tooltipEl.appendChild(table);
      chart.canvas.parentNode.appendChild(tooltipEl);
    }

    return tooltipEl;
  };

  public externalTooltipHandler = (context: any) => {
    // Tooltip Element
    const { chart, tooltip } = context;
    const tooltipEl = this.getOrCreateTooltip(chart);

    // Hide if no tooltip
    if (tooltip.opacity === 0) {
      tooltipEl.style.opacity = 0;
      return;
    }

    // Set Text
    if (tooltip.body) {
      const bodyLines = tooltip.body.map((b: any) => b.lines);
      const projectedCount = bodyLines.filter(
        (l: string[]) => l[0].toLowerCase().indexOf("projected") > -1
      ).length;
      const currentYear = new Date().getFullYear();
      const nextYear = (currentYear + 1) + "";
      const nextYearIndex = this.chartData.labels?.findIndex((s) => {
        if (typeof s === "string") {
          return s.includes(nextYear)
        }
        return false;
      });

      if (bodyLines.length !== projectedCount) {

        if (bodyLines.length) {
          const titleLines = tooltip.title || [];
          const tableHead = document.createElement("thead");
          const headTr = document.createElement("tr");
          const th = document.createElement("th");
          headTr.style.borderWidth = "0";
          th.style.borderWidth = "0";
          th.colSpan = 3;

          titleLines.forEach((title: string) => {
            const labelIndex = this.chartData.labels?.indexOf(title);
            if (title.indexOf("Jan") > -1) {
              title = [title.slice(0,3), ". 1, ", title.slice(4)].join("");
            } else if (labelIndex && nextYearIndex) {
              const notAbbreviated = ["March", "April", "May", "June", "July"];
              const dayText = notAbbreviated.indexOf(title) > -1
                ? " 1, " : ". 1, ";
              title = labelIndex > nextYearIndex
                ? title + dayText + nextYear
                : title + dayText + currentYear;
            }
            const text = document.createTextNode(title);

            th.appendChild(text);
            const hr = document.createElement("hr");
            th.appendChild(hr);
          });

          const tableBody = document.createElement("tbody");
          bodyLines.forEach((body: any, i: any) => {
            const sep = body[0].indexOf(":");
            const amount = "$" + body[0].slice(sep + 2, body[0].length);

            if (i === 0) {
              const div = document.createElement("div");
              div.style.fontWeight = "400";
              const headerTitle = document.createTextNode(this.tooltipHeaderData.title);
              div.appendChild(headerTitle);
              th.appendChild(div);

              const totalAmount = document.createTextNode(amount);
              const h1 = document.createElement("h1");
              h1.appendChild(totalAmount);
              th.appendChild(h1);
              const hr = document.createElement("hr");
              th.appendChild(hr);
              const legend = document.createTextNode(this.tooltipHeaderData.legend);
              th.appendChild(legend);
              headTr.appendChild(th);
              tableHead.appendChild(headTr);
            } else {
              const labelText = body[0].slice(0, sep);
              if (
                body[0].toLowerCase().indexOf("burn") === -1 
                && labelText.toLowerCase().indexOf("projected") === -1
              ) {
                const colors = tooltip.labelColors[i];

                const span = document.createElement("span");
                span.style.background = colors.backgroundColor;
                span.style.borderColor = "#ffffff";
                span.style.borderStyle = "solid";
                span.style.borderWidth = "1px";
                span.style.marginRight = "4px";
                span.style.height = "16px";
                span.style.width = "16px";
                span.style.display = "inline-block";

                const tr = document.createElement("tr");
                tr.style.backgroundColor = "inherit";
                tr.style.borderWidth = "0";

                const td1 = document.createElement("td");
                td1.style.borderWidth = "0";
                td1.appendChild(span);
                tr.appendChild(td1);

                const td2 = document.createElement("td");
                const text = document.createTextNode(labelText);
                td2.appendChild(text);
                tr.appendChild(td2);

                const td3 = document.createElement("td");
                td3.style.paddingLeft = "8px";
                const val = document.createTextNode(amount);
                td3.appendChild(val);
                tr.appendChild(td3);

                tableBody.appendChild(tr);
              }
            }
          });

          const tableRoot = tooltipEl.querySelector("table#lineChartTooltipTable");
          // Remove old children
          while (tableRoot.firstChild) {
            tableRoot.firstChild.remove();
          }
          // Add new children
          tableRoot.appendChild(tableHead);
          tableRoot.appendChild(tableBody);
        }

        const { offsetLeft: positionX, offsetTop: positionY } = chart.canvas;

        // Display, position, and set styles for font
        tooltipEl.style.opacity = 1;
        tooltipEl.style.left = positionX + tooltip.caretX + "px";
        tooltipEl.style.top = positionY + tooltip.caretY + "px";
        tooltipEl.style.font = tooltip.options.bodyFont.string;
        tooltipEl.style.padding =
          tooltip.options.padding + "px " + tooltip.options.padding + "px";
      };
    }
  }
}
